import ExpenseItems from "./components/ExpenseItem";

function App() {
  expense = [{ title: "sam" }, { title: "raj" }, { title: "sagaya" }];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItems title={expense[0].title}></ExpenseItems>
    </div>
  );
}

export default App;
